    'about.AboutBrand': 'OLX\u092C\u0926\u094D\u0926\u0932',
    'about.AboutText1': 'OLX \u0939\u093E \u091B\u094B\u091F\u094D\u092F\u093E \u091C\u093E\u0939\u093F\u0930\u093E\u0924\u0940\u0902\u091A\u093E (\u0915\u094D\u0932\u093E\u0938\u093F\u092B\u093E\u0907\u0921\u094D\u0938\u091A\u093E) \u091C\u0917\u093E\u0924\u0940\u0932 \u090F\u0915 \u0905\u0917\u094D\u0930\u0917\u0923\u094D\u092F \u092E\u0902\u091A \u0906\u0939\u0947 \u0906\u0923\u093F \u092E\u094B\u092C\u093E\u0908\u0932 \u0924\u0938\u0947\u091A \u0906\u0902\u0924\u0930\u091C\u093E\u0932\u093E\u0935\u0930\u0940\u0932 (\u0911\u0928\u0932\u093E\u0907\u0928) \u0909\u0926\u092F\u094B\u0928\u094D\u092E\u0941\u0916 \u092C\u093E\u091C\u093E\u0930\u092A\u0947\u0920\u093E\u0902\u0935\u0930 \u092F\u093E \u092E\u0902\u091A\u093E\u0928\u0947 \u0932\u0915\u094D\u0937 \u0915\u0947\u0902\u0926\u094D\u0930\u0940\u0924 \u0915\u0947\u0932\u0947 \u0906\u0939\u0947.',
    'about.AboutText2': 'OLX \u091A\u0947 \u0915\u093E\u0930\u094D\u092F \u091C\u093E\u0917\u0924\u093F\u0915 \u092A\u093E\u0924\u0933\u0940\u0935\u0930 \u091A\u093E\u0932\u0924\u0947 \u0906\u0923\u093F \u096A\u0966 \u092A\u0947\u0915\u094D\u0937\u093E \u091C\u093E\u0938\u094D\u0924 \u0926\u0947\u0936\u093E\u0902\u0924 \u092F\u093E\u091A\u0947 \u0905\u0938\u094D\u0924\u093F\u0924\u094D\u0924\u094D\u0935 \u0906\u0939\u0947.',
    'about.about_Body': '<p>OLX \u092E\u094D\u0939\u0923\u091C\u0947 \u0935\u093F\u0928\u093E\u092E\u0942\u0932\u094D\u092F \u0926\u0930\u093E\u0924\u0940\u0932 \u0911\u0928\u0932\u093E\u0908\u0928 \u091B\u094B\u091F\u094D\u092F\u093E \u091C\u093E\u0939\u093F\u0930\u093E\u0924\u0940\u0902\u091A\u0940 \u092A\u0941\u0922\u091A\u0940 \u092A\u093F\u0922\u0940 \u0939\u094B\u092F.<br /><br />\u0924\u0941\u092E\u094D\u0939\u0940 \u0915\u0941\u0920\u0947\u0939\u0940 \u0930\u0939\u093E\u0924 \u0905\u0938\u0932\u093E\u0924 \u0924\u0930\u0940 \u0916\u0930\u0947\u0926\u0940-\u0935\u093F\u0915\u094D\u0930\u0940 \u0915\u0930\u0923\u0947, \u0935\u094D\u092F\u093E\u092A\u093E\u0930 \u0915\u0930\u0923\u0947, \u091A\u0930\u094D\u091A\u093E \u0915\u0930\u0923\u0947, \u0928\u093F\u092F\u094B\u091C\u0928 \u0915\u0930\u0923\u0947, \u0924\u0941\u092E\u091A\u094D\u092F\u093E \u091C\u0935\u0933\u092A\u093E\u0938 \u0930\u093E\u0939\u0923\u093E\u0931\u094D\u092F\u093E \u0932\u094B\u0915\u093E\u0902\u091A\u094D\u092F\u093E \u092D\u0947\u091F\u0940\u0917\u093E\u0920\u0940 \u0918\u0947\u0923\u0947 \u0907. \u0917\u094B\u0937\u094D\u091F\u0940\u0902\u092E\u0927\u0932\u094D\u092F\u093E \u0915\u093F\u091A\u0915\u091F\u092A\u0923\u093E\u0935\u0930\u0940\u0932 \u0938\u093E\u0927\u093E \u0909\u092A\u093E\u092F \u092E\u094D\u0939\u0923\u091C\u0947 OLX.<br /><br /> OLX \u0935\u0930 \u0924\u0941\u092E\u094D\u0939\u0940 \u0916\u093E\u0932\u0940\u0932 \u0917\u094B\u0937\u094D\u091F\u0940 \u0915\u0930\u0941 \u0936\u0915\u0924\u093E:<br /><ul> <li\u091A\u093F\u0924\u094D\u0930\u093E\u0902\u0928\u0940 \u0938\u092E\u0943\u0926\u094D\u0927 \u091C\u093E\u0939\u093F\u0930\u093E\u0924\u0940\u0902\u091A\u0940 \u0938\u0939\u091C\u0924\u0947\u0928\u0947 \u0930\u091A\u0928\u093E \u0915\u0930\u093E.</li> <li>\u092E\u093E\u091D\u094D\u092F\u093E OLX\u092E\u0927\u094D\u092F\u0947 \u0924\u0941\u092E\u091A\u0947 \u0938\u0947\u091F\u093F\u0902\u0917, \u0916\u0930\u0947\u0926\u0940-\u0935\u093F\u0915\u094D\u0930\u0940, \u0938\u092E\u0941\u0926\u093E\u092F\u093E\u0924\u0940\u0932 \u0905\u200D\u0945\u0915\u094D\u091F\u093F\u0935\u094D\u0939\u093F\u091F\u0940 \u092F\u093E\u0935\u0930 \u0928\u093F\u092F\u0902\u0924\u094D\u0930\u0923 \u0920\u0947\u0935\u0942 \u0936\u0915\u0924\u093E</li> <li>\u0924\u0941\u092E\u091A\u094D\u092F\u093E \u0938\u094B\u0936\u0932 \u0928\u0947\u091F\u0935\u0930\u094D\u0915\u0940\u0902\u0917 \u092A\u094D\u0930\u094B\u092B\u093E\u0908\u0932\u094D\u0938\u0935\u0930 \u0924\u0941\u092E\u091A\u094D\u092F\u093E \u091C\u093E\u0939\u093F\u0930\u093E\u0924\u0940 \u091D\u0933\u0915\u0935\u0942 \u0936\u0915\u0924\u093E (Facebook, Myspace, ...)</li> <li>\u0939\u0947 \u0938\u0902\u0915\u0947\u0924\u0938\u094D\u0925\u0933 \u0924\u0941\u092E\u094D\u0939\u0940 \u0924\u0941\u092E\u091A\u094D\u092F\u093E \u092D\u094D\u0930\u092E\u0923\u0927\u094D\u0935\u0928\u0940\u0935\u0930\u0941\u0928\u0939\u0940 \u0935\u093E\u092A\u0930\u0941 \u0936\u0915\u0924\u093E</li> <li>OLX \u0924\u0941\u092E\u091A\u094D\u092F\u093E \u0938\u094D\u0925\u093E\u0928\u093F\u0915 \u092D\u093E\u0937\u0947\u0924 \u092A\u093E\u0939\u0942 \u0936\u0915\u0924\u093E</li></ul> <br /> OLX <<QTY_COUNTRIES>> \u0926\u0947\u0936\u093E\u0902\u092E\u0927\u094D\u092F\u0947 \u0935 <<QTY_LANGUAGES>> \u092D\u093E\u0937\u093E\u0902\u092E\u0927\u094D\u092F\u0947 \u0935\u093E\u092A\u0930\u0932\u0947 \u091C\u093E\u0924\u0947. \u0939\u0940 \u0915\u0902\u092A\u0928\u0940 \u0916\u093E\u091C\u0917\u0940 \u092E\u093E\u0932\u0915\u0940\u091A\u0940 \u0905\u0938\u0942\u0928 \u0924\u093F\u091A\u0940 \u0938\u094D\u0925\u093E\u092A\u0928\u093E \u092E\u093E\u0930\u094D\u091A \u0968\u0966\u0966\u096C \u092E\u0927\u094D\u092F\u0947 \u0915\u0930\u0923\u094D\u092F\u093E\u0924 \u0906\u0932\u0940.</p>',
